import Logo from "./Logo";
import { Row, Col } from "react-bootstrap";
import { skill } from "../info";
export default function Skill() {
  return (
    <Row>
      {skill.map((item) => {
        return (
          <Col lg="3">
            <Logo path={item.path} alt={item.alt}></Logo>
          </Col>
        );
      })}
      <Col lg="3">
        <Logo path="images/HTML5_Logo.svg" alt="Html5"></Logo>
      </Col>
      <Col lg="3">
        <Logo path="images/CSS3_Logo.svg" alt="Css3"></Logo>
      </Col>
      <Col lg="3">
        <Logo path="images/logo-javascript.svg" alt="Javascript"></Logo>
      </Col>
      <Col lg="3">
        <Logo path="images/react-2.svg" alt="react"></Logo>
      </Col>
      <Col lg="3">
        <Logo path="images/linux-tux.svg" alt="linux"></Logo>
      </Col>
      <Col lg="3">
        <Logo path="images/git.svg" alt="git"></Logo>
      </Col>
      <Col lg="3">
        <Logo path="images/sqlite.svg" alt="sqlite"></Logo>
      </Col>
      <Col lg="3">
        <Logo path="images/r-lang.svg" alt="R-language"></Logo>
      </Col>
      <Col lg="3">
        <Logo path="images/bootstrap-5-1.svg" alt="bootstrap"></Logo>
      </Col>
    </Row>
  );
}
